    return (
        <div className={style.container}>
            <div className={style.hard}>
                <h2>Hard</h2>
            <DiNodejs size={200}/>
            <DiPostgresql size={150}/>
            <DiMongodb size={120}/>
            <DiReact size={150}/>
            <SiRedux size={110}/>
            <DiCss3 size={120}/>
            <DiHtml5 />
            </div>
        </div>
    );
};

export default Skills;
